import JoblyApi from "./api";

const CompanyDetails = () => {
    const {handle} = useParams();
    const company = JoblyApi.getCompany(handle);

    return (
        <div>
            <h1>{company}</h1>
        </div>
    )
}

export default CompanyDetails;
